// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.16 <0.9.0;
pragma experimental ABIEncoderV2;

contract IntroMoney {
  address owner;

  struct User {
    uint256 id;
    uint256 balance;
    bytes32 username;
    bool exists;
  }
  uint256 userId;
  mapping(address => User) public users;
  address[] public usersList;

  struct Message {
    uint256 id;
    address owner;
    string text;
    address[] reader;
    bytes[] encryptedMessages;
    bytes32[] usedPasswords;
    uint256 readReward;
    uint256 replyReward;
    bool exists;
  }
  uint256 messageId;
  mapping(uint256 => Message) messages;

  struct ConversationMessage {
    uint256 id;
    address owner;
    bytes text;
    bool exists;
  }
  struct Conversation {
    address owner;
    address recipient;
    uint256 readReward;
    uint256 replyReward;
    bool exists;
    ConversationMessage[] messages;
    uint32 id;
    uint256 messageId;
  }
  uint32 conversationId;

  mapping(address => uint32[]) ownerConversations;
  mapping(address => uint32[]) recipientConversations;
  mapping(uint32 => Conversation) conversations;
  mapping(uint32 => address) paidReads;
  mapping(uint32 => address) paidReplies;

  function createConversation(
    bytes memory _encryptedMessage,
    uint256 _readReward,
    uint256 _replyReward
  ) public returns (bool) {
    require(isRegistered(msg.sender), "You are not registered");

    conversations[conversationId].owner = msg.sender;
    conversations[conversationId].readReward = _readReward;
    conversations[conversationId].replyReward = _replyReward;
    conversations[conversationId].exists = true;
    ConversationMessage memory message =
      ConversationMessage({
        id: conversations[conversationId].messageId,
        owner: msg.sender,
        text: _encryptedMessage,
        exists: true
      });
    conversations[conversationId].messages.push(message);
    ownerConversations[msg.sender].push(conversationId);
    conversations[conversationId].messageId++;
    conversations[conversationId].id = conversationId;
    conversationId++;

    // emit CreateConversation(msg.sender, messageId);
    // emit CreateMessage(msg.sender, messageId);

    return true;
  }

  function addMessageToConversation(
    uint32 _conversationId,
    bytes memory _encryptedMessage,
    address _participant
  ) public returns (bool) {
    require(isOwner(msg.sender), "You are not the contract owner");
    require(
      conversations[_conversationId].exists == true,
      "Conversation does not exist"
    );
    require(
      conversations[_conversationId].owner == _participant ||
        conversations[_conversationId].recipient == _participant,
      "Not allowed."
    );

    if (
      conversations[_conversationId].recipient == _participant &&
      paidReplies[_conversationId] == address(0)
    ) {
      require(
        users[conversations[_conversationId].owner].balance >=
          conversations[_conversationId].replyReward,
        "Message owner does not afford this"
      );
      users[conversations[_conversationId].owner].balance -= conversations[
        _conversationId
      ]
        .replyReward;
      users[_participant].balance += conversations[_conversationId].replyReward;
    }

    ConversationMessage memory message =
      ConversationMessage({
        id: conversations[conversationId].messageId,
        owner: _participant,
        text: _encryptedMessage,
        exists: true
      });
    conversations[conversationId].messages.push(message);
    conversations[conversationId].messageId++;

    return true;
  }

  function readConversationByParticipant(
    uint32 _conversationId,
    address _participant
  ) public returns (bool) {
    require(isOwner(msg.sender), "You are not the contract owner");
    require(
      conversations[_conversationId].exists == true,
      "Conversation does not exist"
    );
    require(
      conversations[_conversationId].recipient == address(0),
      "Not allowed"
    );
    require(
      users[conversations[_conversationId].owner].balance >=
        conversations[_conversationId].readReward,
      "Message owner does not afford this"
    );

    conversations[_conversationId].recipient = _participant;
    users[conversations[_conversationId].owner].balance -= conversations[
      _conversationId
    ]
      .readReward;
    users[_participant].balance += conversations[_conversationId].readReward;

    recipientConversations[_participant].push(conversationId);
    paidReads[_conversationId] = _participant;

    return true;
  }

  function isOwner(address _owner) public view returns (bool) {
    return owner == _owner;
  }

  function getConversations() public view returns (Conversation[] memory) {
    require(isRegistered(msg.sender));

    Conversation[] memory userConversations =
      new Conversation[](
        ownerConversations[msg.sender].length +
          recipientConversations[msg.sender].length
      );
    uint256 j = 0;
    for (uint256 i = 0; i < ownerConversations[msg.sender].length; i++) {
      userConversations[j++] = conversations[ownerConversations[msg.sender][i]];
    }

    for (uint256 i = 0; i < recipientConversations[msg.sender].length; i++) {
      userConversations[j++] = conversations[
        recipientConversations[msg.sender][i]
      ];
    }

    return userConversations;
  }

  function getConversation(uint32 _conversationId)
    public
    view
    returns (Conversation memory)
  {
    require(isRegistered(msg.sender), "You are not registered");
    require(
      conversations[_conversationId].exists,
      "Conversation doesn't exist"
    );
    require(
      conversations[_conversationId].recipient == address(0) ||
        conversations[_conversationId].recipient == msg.sender ||
        conversations[_conversationId].owner == msg.sender,
      "Not allowed"
    );

    return conversations[_conversationId];
  }

  mapping(address => uint256[]) userCreatedMessages;
  mapping(address => uint256[]) userReadMessages;

  event Deposit(address indexed _from, uint256 _value);
  event CreateMessage(address indexed _from, uint256 _messageId);
  event Register(address indexed _from);

  // create conversation with password
  // add message to conversation - by the owner with the api call after password verification
  // transferReadReward method to transfer the read reward to the reader - by the owner with the api call
  // save reader address to local storage
  // save reader address to local storage for that message
  // save reader address to local storage for that message read payment
  // if add message to conversation by the replier - by the owner with the api call after password verification
  // transferRepyReward method to transfer the reply reward to the reader - by the owner with the api call
  // save reader address to local storage for that message
  // save reader address to local storage for that message payment
  // if other address opens that conversation => throw error
  // create username index to allow search by username

  constructor(
    uint256 _messageId,
    uint256 _userId,
    uint32 _conversationId,
    address _owner
  ) public {
    messageId = _messageId; // should be 1
    userId = _userId; // should be 1
    owner = _owner;
    conversationId = _conversationId;
  }

  function register(bytes32 _username) public returns (bool) {
    require(!isRegistered(msg.sender));

    users[msg.sender] = User({
      balance: 0 wei,
      username: _username,
      id: userId,
      exists: true
    });
    // usersList.push(msg.sender) - 1;
    // users[msg.sender].balance = 0;
    // users[msg.sender].username = _username;
    // users[msg.sender].id = userId;
    // users[msg.sender].exists = true;
    emit Register(msg.sender);
    userId++;

    return true;
  }

  function isRegistered(address sender) public view returns (bool) {
    return users[sender].exists;
  }

  function deposit() public payable returns (bool) {
    require(isRegistered(msg.sender));

    users[msg.sender].balance += msg.value;
    emit Deposit(msg.sender, msg.value);

    return true;
  }

  function balance() public view returns (uint256) {
    require(isRegistered(msg.sender));

    return users[msg.sender].balance;
  }

  function username() public view returns (bytes32) {
    require(isRegistered(msg.sender));

    return users[msg.sender].username;
  }

  function createMessages(
    bytes32[] memory _encryptedMessages,
    uint256 _readReward,
    uint256 _replyReward
  ) public returns (bool) {
    require(isRegistered(msg.sender));
    require(_encryptedMessages.length > 0);

    messages[messageId].owner = msg.sender;
    messages[messageId].id = messageId;
    messages[messageId].exists = true;
    messages[messageId].readReward = _readReward;
    messages[messageId].replyReward = _replyReward;
    for (uint256 i = 0; i < _encryptedMessages.length; i++) {
      // messages[messageId].encryptedMessages.push(_encryptedMessages[i]);
    }
    userCreatedMessages[msg.sender].push(messageId);
    emit CreateMessage(msg.sender, messageId);
    messageId++;

    return true;
  }

  function createMessage(
    bytes memory _encryptedMessage,
    uint256 _readReward,
    uint256 _replyReward
  ) public returns (bool) {
    require(isRegistered(msg.sender));

    messages[messageId].owner = msg.sender;
    messages[messageId].id = messageId;
    messages[messageId].exists = true;
    messages[messageId].readReward = _readReward;
    messages[messageId].replyReward = _replyReward;
    messages[messageId].encryptedMessages.push(_encryptedMessage);
    userCreatedMessages[msg.sender].push(messageId);
    emit CreateMessage(msg.sender, messageId);
    messageId++;

    return true;
  }

  function getMessages() public view returns (Message[] memory) {
    require(isRegistered(msg.sender));

    Message[] memory userMessages =
      new Message[](userCreatedMessages[msg.sender].length);
    for (uint256 i = 0; i < userCreatedMessages[msg.sender].length; i++) {
      userMessages[i] = messages[userCreatedMessages[msg.sender][i]];
    }

    return userMessages;
  }

  function transfer(
    address recipientAddress,
    address fromAddress,
    uint256 amount
  ) public returns (bool) {}

  function widthraw() public returns (bool) {}
}
